Verenigd Koninkrijk / Hongarije / Frankrijk
Fantasy / Avontuur
103 minuten

een leuke familie film

met Ioan Gruffudd, Dakota Blue Richards en Natascha McElhone

De pracht van het landgoed Moonacre wordt overschaduwd door herinneringen aan de Maanprinses en het mysterieuze witte paardje. 
Tot haar verrassing ontdekt Maria Merryweather, een vreemdelinge in het Kasteel van Moonacre, dat wat er al die jaren geleden met 
de Maanprinses gebeurd is, ook met haar te maken heeft. Ze is vastbesloten vrede en geluk terug te brengen in de vallei. En Maria 
krijgt meestal haar zin.
